import { lazy } from 'react';
import ViewEmail from '../components/ViewEmail';

const Main = lazy(() => import('../pages/Main'));
const Emails = lazy(() => import('../components/Emails'));

const routes = {
  main: {
    path: '/',
    element: Main,
  },
  emails: {
    path: '/emails',
    element: Emails,
  },
  invalid: {
    path: '/*',
    element: Emails,
  },
  view: {
    path: '/view',
    element: ViewEmail,
  },
};

export { routes };
